@hellobabygogo thank you for the contribution. 

> If the the new task started with the wrong start offsets, it will be failed after a task duration. 

I wonder when new tasks have wrong start offsets. Do you have logs related to this issue?

The flame chart may be misleading here. The way the query runner stack is supposed to work is that `QueryRunner.run` prepares a Sequence, which is then accumulated in a later step. The code that drives this is in ChainedExecutionQueryRunner.

```java
Sequence<T> result = input.run(threadSafeQueryPlus, responseContext);
if (result == null) {
  throw new ISE("Got a null result! Segments are missing!");
}

List<T> retVal = result.toList();
```

The call stack for the `result.toList()` part might not mention all of the QueryRunners, since not every QueryRunner leaves a piece of itself behind in the Sequence. For example the reference counting runner does:

```java
final Sequence<T> baseSequence = factory.createRunner(adapter).run(queryPlus, responseContext);
return Sequences.withBaggage(baseSequence, adapter.decrementOnceCloseable());
```

And so it won't appear in the call stack for accumulate.

